pragma solidity ^0.5.7;

contract Oracle {
    struct Msg{
        address sender;
        address auction;
        string operation;
        uint Auctioncnt;
    }
    mapping(uint=>Msg) Msgs;
    //new add
    mapping (address=>Msg) tmpmsgs;
    
    uint messagesNum = 0;
    address[]Auctions;
    address owner= msg.sender;
    
    address public cbAddress; // callback address
    
    constructor ()public  {

    }

    event newAuction(address);
    event newMsg(address,string, address);
    event QueryAuctionsNum(uint);
    event QueryMsg(address, string , address);
    event QueryMsgNum(uint);
    event QueryAuctions(address);

    function setCbAddress(address _cbAddress) public {
        cbAddress = _cbAddress;
    }

    event checkMSGNUM(uint);
    event checkMSGNUM2222(uint);
    
    uint count=0;
    function operationCallback(address _sender, string memory _operation, address _auction)public returns (uint){
        Msg memory m;
        m.sender=_sender;
        m.auction = _auction;
        m.operation = _operation;
        Msgs[messagesNum]=m;
        
        count++;
        if (msg.sender != owner && count%2==0)
        {
            messagesNum++;
        }
        
        
        emit checkMSGNUM(messagesNum);
        
        tmpmsgs[msg.sender].Auctioncnt = messagesNum;
        return tmpmsgs[msg.sender].Auctioncnt;
        emit newMsg(_sender, _operation, _auction);
        
        emit checkMSGNUM2222(messagesNum);

    }
    
    function newAuctionCallback(address auction)public{
        Auctions.push(auction);
        emit newAuction(auction);
    }
    
    function getAuction(uint index)public returns(address){
        return Auctions[index];
        emit QueryAuctions(Auctions[index]);
    }
    
    function getNumOfAuction()public returns(uint){
        return Auctions.length;
        emit QueryAuctionsNum(Auctions.length);
    }
    
    function getOperation(uint index)public returns(string memory){
        return Msgs[index].operation;
        emit QueryMsg(Msgs[index].sender,Msgs[index].operation,Msgs[index].auction);
    }

    function getNumOfOperation ()public returns(uint){
        return messagesNum;
        emit QueryMsgNum(messagesNum);
    }
    
}
